            "snippet": {
              "videoId": "yuD34tEpRFw",
              "textDisplay": "@Luke Raphael \r\u003cbr\u003e&quot; \u003ci\u003eI thought you could figure out that the light path of 2 m was diagonal but obviously not\u003c/i\u003e &quot;\r\u003cbr\u003eoh, so you are just going with the &quot; i knew that, i was just testing whether you knew that or not&quot; tactic. In physics, words have very rigorous meanings. In the context of this thought experiment, the words &quot;top to bottom&quot; have a very concrete and specific meaning. i thought  you would know thisbut obviously you do not. Dont use &quot;top to bottom&quot; and then expect that the other party should just understand that you actually meant &quot;diagonal&quot;. \r\u003cbr\u003e\r\u003cbr\u003e\r\u003cbr\u003e&quot; \u003ci\u003eHow can both light clock pulses be traveling two-way in their own frame and one-way in the other frame over the same distance\u003c/i\u003e &quot;\r\u003cbr\u003eThat is how the reciprocal nature of time dilation works. In each clock&#39;s frame, the OTHER clock ticks slower. So, in each clock&#39;s frame, within the time interval in which it&#39;s own light pulse has travelled two-way, the other light clock&#39;s pulse has not travelled two-way.\r\u003cbr\u003eVice versa for the other clock. Because , every calculation that you did in the frame of one clock, can be replicated exactly in the frame of the other clock. \r\u003cbr\u003e\r\u003cbr\u003e&quot; \u003ci\u003eIt&#39;s literally two completely different versions of reality, in one the light pulse hit the bottom and bounced at 0.866 m and in the other it hit the bottom at 1.732 m and never bounced\u003c/i\u003e &quot;\r\u003cbr\u003eOf course , it is two different versions of reality. that is what the concept of reference frames in relativity implies. In different frames, there will be different versions of how things play out. That is as expected and as predicted by relativity. That is one of the basics of relativity. That in different frames, time intervals are different, distances are different and the chronological order of events are different. Also, it is not true that in the other frame, it hit the bottom and &quot;never bounced&quot;. It did bounce. But it did so, at a different time than it did in the other frame.",
              "textOriginal": "@Luke Raphael \r\n\" _I thought you could figure out that the light path of 2 m was diagonal but obviously not_ \"\r\noh, so you are just going with the \" i knew that, i was just testing whether you knew that or not\" tactic. In physics, words have very rigorous meanings. In the context of this thought experiment, the words \"top to bottom\" have a very concrete and specific meaning. i thought  you would know thisbut obviously you do not. Dont use \"top to bottom\" and then expect that the other party should just understand that you actually meant \"diagonal\". \r\n\r\n\r\n\" _How can both light clock pulses be traveling two-way in their own frame and one-way in the other frame over the same distance_ \"\r\nThat is how the reciprocal nature of time dilation works. In each clock's frame, the OTHER clock ticks slower. So, in each clock's frame, within the time interval in which it's own light pulse has travelled two-way, the other light clock's pulse has not travelled two-way.\r\nVice versa for the other clock. Because , every calculation that you did in the frame of one clock, can be replicated exactly in the frame of the other clock. \r\n\r\n\" _It's literally two completely different versions of reality, in one the light pulse hit the bottom and bounced at 0.866 m and in the other it hit the bottom at 1.732 m and never bounced_ \"\r\nOf course , it is two different versions of reality. that is what the concept of reference frames in relativity implies. In different frames, there will be different versions of how things play out. That is as expected and as predicted by relativity. That is one of the basics of relativity. That in different frames, time intervals are different, distances are different and the chronological order of events are different. Also, it is not true that in the other frame, it hit the bottom and \"never bounced\". It did bounce. But it did so, at a different time than it did in the other frame.",
